sq--src-components-banner-js.query:
query profileImage {
  file(relativePath: {eq: "mahipat-bike.jpg"}) {
    childImageSharp {
      sizes(maxWidth: 250, maxHeight: 350) {
        ...GatsbyImageSharpSizes
      }
    }
  }
}

fragment GatsbyImageSharpSizes on ImageSharpSizes {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

sq--src-components-project-js.query:
query projectList {
  allProjectsJson {
    edges {
      node {
        name
        link
        description
        id
        image {
          childImageSharp {
            fluid(maxHeight: 250) {
              ...GatsbyImageSharpFluid
            }
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}
